import "./Expenses.css";
import ExpenseItem from "./ExpenseItems";
import Card from "./Card";

function Expenses(props) {
  return props.exp.map((obj) => {
    return (
      <Card className="expenses">
        <ExpenseItem title={obj.title} amount={obj.amount} date={obj.date} />
      </Card>
    );
  });

